def show_entity_lists(lists):
    for i in range(len(lists)):
        print(f'list {i}: {len(lists[i])}')
        for entity in lists[i]:
            print(h_kind(entity['kind']), end='\t')
            kind = int(entity['kind'])
            id = int(entity['id'])
            if kind == 3:
                print(enemies[id])
            elif kind == 6:
                print(objects[id])
            elif kind == 7:
                print(npcs[id])
            else:
                print(hex(id))

            print(entity['x']['HALF']['HI'])
            print(entity['y']['HALF']['HI'])

if __name__ == '__main__':
    show_entity_lists(lists)